        public static void FillProcessDetails()
        {
            ArrayList dict = new ArrayList();
            Dictionary<string, string> processorDetails = new Dictionary<string, string>();
            ArrayList al = new ArrayList();
            StreamReader sr = new StreamReader("c:\\1.txt");
            string content = sr.ReadToEnd();
            string[] contents = content.Split("\n".ToCharArray());
            foreach (string s in contents)
            {
                if (s.Contains("\r"))
                {
                    if (!dict.Contains(s.Remove(s.Length - 1)))
