                //for dictionary 
                //sw.WriteLine("processorDetails2.Add(\"" + s + "\",\"\");");

                //for arraylist
                sw.WriteLine("processorDetails.Add(\"" + s + "\");");

            }
            sw.Close();
        }

        public static void GetReferenceCount()
        {
            string parentDirPath = @"C:\inetpub\wwwroot\JetStream\Website\bin";
            string dir1 = @"C:\inetpub\wwwroot\JetStream\Website\bin";

            int referredAssemblyCount = 0;
            Assembly currAssembly;
            AssemblyName[] assemblyName;
            ArrayList assemblyNameList = new ArrayList();


            int instanceIndex = parentDirPath.IndexOf(@"\Website\bin");
            parentDirPath = parentDirPath.Substring(0, parentDirPath.Length - (parentDirPath.Length - instanceIndex));
            int instanceNamestartIndex = parentDirPath.LastIndexOf(@"\");
            string instanceName = parentDirPath.Substring(instanceNamestartIndex + 1, parentDirPath.Length - instanceNamestartIndex - 1);


            DirectoryInfo dir = new DirectoryInfo(dir1);
            foreach (FileInfo file in dir.GetFiles())
            {
                if (file.Extension.ToLower().Equals(".dll") && file.Name.ToLower().Contains(instanceName.ToLower()))
                {

                    currAssembly = Assembly.LoadFile(dir1 + @"\" + file.Name);
                    assemblyName = currAssembly.GetReferencedAssemblies();
                    foreach (AssemblyName name in assemblyName)
                    {
                        if ((!name.Name.ToLower().Contains("mscorlib") && !name.Name.ToLower().Contains("system") &&
                            !name.Name.ToLower().Contains("sitecore") && !name.Name.ToLower().Contains("microsoft")) &&
                            !assemblyNameList.Contains(name.Name))
                        {
                            assemblyNameList.Add(name.Name);
                            referredAssemblyCount++;
                        }
                    }
                    //referredAssemblyCount += (currAssembly.GetReferencedAssemblies()).Length;
                    //counter++;
                }

            }
        }

