        private static void GetCustomProcessorList(ArrayList fileList)
        {
            //ArrayList configFileList = new ArrayList();
            StreamWriter sw1 = new StreamWriter("c:\\processorList1.txt");
            foreach (FileInfo file in fileList)
            {
                string contents = File.ReadAllText(file.FullName);
                if (contents.ToLower().Contains("<processor"))
                {
                    XmlDocument xmlDoc = new XmlDocument();
                    xmlDoc.LoadXml(contents);

                    string xpath = "//processor[@type]";
                    var nodes = xmlDoc.SelectNodes(xpath);
                    StringBuilder processorName = new StringBuilder();

                    #region commented code
                    //configFileList.Add(file.FullName);

                    //StreamWriter sw = new StreamWriter("c:\\processorList.txt");



                    //foreach (string s in processorDetails)
                    //{
                    //    sw.WriteLine(s);

                    //}
                    //sw.Close();


                    #endregion

                    foreach (XmlNode childrenNode in nodes)
                    {
                        processorName.Append(childrenNode.Attributes["type"].Value);
                        if (childrenNode.Attributes["method"] != null)
                        {
                            processorName.Append(" - " + childrenNode.Attributes["method"].Value);
                        }
                        

                        if (!processorDetails.Contains(processorName.ToString()))
                        {
                            if (!cutomProcessorList.Contains(processorName))
                            {
                                cutomProcessorList.Add(processorName.ToString());
                                sw1.WriteLine(processorName.ToString());
                            }
                            //sw1.WriteLine(processorName.ToString());

                        }
                        processorName.Clear();
                    }

                    #region commented code


                    //var list = nodes.Cast<XmlNode>().
                    //Select(node => !processorDetails.Contains(node.Attributes["type"].Value))
                    //.ToList();

                    //cutomProcessorList.AddRange(list);
                    //var list = from childrenNode in nodes
                    //           where processorDetails.ContainsKey(childrenNode.Attributes["type"].Value)
                    //           select childrenNode;


                    //childrenNode.Attributes["type"].Value
                    //childrenNode.Attributes["method"]
                    //}
                    #endregion

                }


            }
            sw1.Close();
        }

