        private static void GetFilesFromDirectory(DirectoryInfo dir)
        {
            foreach (FileInfo file in dir.GetFiles())
            {
                if (file.Extension.ToLower().Equals(".config"))
                {
                    fileList.Add(file);
                }
            }
        }


        private static void IterateSubDirectoriesForFiles(DirectoryInfo parentDir)
        {
            foreach (DirectoryInfo subDir in parentDir.GetDirectories())
            {
                GetFilesFromDirectory(subDir);

                if (subDir.GetDirectories() != null && subDir.GetDirectories().Count() > 0)
                {
                    IterateSubDirectoriesForFiles(subDir);
                }
            }
        }
